const LandingPage = () => {


    return(
    <Fragment>
        <div className={styles.container}>


        <div className ={styles.darkDiv}>
            <h2 className={styles.aboutText}>My name is Jacek Hacking and I am a fullstack web developer with an emphasis on Front-End web development. I graduated from the University of Utah's accelerated fullstack Bootcamp.</h2>
        </div>
        <div className = {styles.selfieDiv}>

        </div>
        </div>
    </Fragment>
    )
}

export default LandingPage
